import React from "react";
import classes from "./TopIdBarLeft.module.css"
import TopIdBarTools from './TopIdBarTools';
//import userImage from '../../../../images/BibhuprasadMahakud.jpg'

//import basewebURL from "../../../../basewebURL";


const TopIdBarLeft = (props) =>{





let imageurl;
if (window.location.host==="localhost:3000"){
 imageurl= "http://127.0.0.1:8000"+props.data.profile_image //basewebURL
}

if (window.location.host==="127.0.0.1:8000"){
 imageurl= "http://127.0.0.1:8000"+props.data.profile_image //basewebURL
}


if (window.location.host==="edresearch.co.in"){
 imageurl= props.data.profile_image //basewebURL
}









return(

<div className={classes.topIdBarLeft}>


  <div className={classes.userImageIcon}>

    <img className={classes.userImage} src={imageurl} alt='edr Logo' />


  </div>



  <TopIdBarTools onPress={props.onPress}/>






</div>

);

}

export default TopIdBarLeft;
